commits.content:
.box1{
     width:85%;
     background:rgba(0, 0, 255, 0.051);
     float:right;


}

.box2{
    background:rgba(255, 192, 203, 0.01);
    border-radius:8px; 
    margin:10px;
    height:222.5px;
    width:150px;
    box-shadow:0px 0px 2px orangered;


}
 .image{
    width:100%;
    height:150px;
    border-radius:8px 8px 0px 0px;
 }
 .text{

   display: grid;


 }
 a{
    margin-top:0%;
    padding: 0%;
    font-size: 10px;
    text-decoration: none;
    margin-left: 2px;

 }
 .name{
    width:60%;
    text-decoration: none;
 }
 .cart{
    margin:0% ;

 }
 .btn{
    width:100%;
    height:25px;
    text-align: center;
    padding: 0px;
    margin-top: 0px;
    border-radius: 0px 0px 8px 8px;

 }

 @media(max-width:760px){
    .box1{
        width: 100%;
    }


 }
  @media(max-width:1000px){



  }
